description:
Sera supprimé en automne 2007. 
Il s'agit d'un objet à part entière du type Loisirs; 
les gymnase ne sont pas, dans la grande majorité des cas, des équipements complémentaires à d'autres objets; 
utiliser "salle de sport". 

Supprimé (inactivé car tif) le 25/07/2008

Par suite des nouvelles décisions gouvernementales, à partir du 21 juillet 2021 : le « pass sanitaire » sera étendu à tous les lieux de loisirs et de culture rassemblant plus de 50 personnes ;
Début août 2021 : Le « pass sanitaire » sera étendu aux cafés, restaurants, centres commerciaux, hôpitaux, maisons de retraite, établissements médico-sociaux, ainsi qu’aux voyages en avions, trains et cars pour les trajets de longue distance.

Sur demande, le critère “Pass sanitaire obligatoire” pourra bien entendu être activé sur d’autres types ou sous-types si nécessaire.
